const hackAndGetToken1 = (validEncodedToken: any) => {
    const decodedToken = decodeToken(validEncodedToken)
    const decodedContent = decodedToken.payload.claim;
    const decodedPubKey = decodedToken.payload.issuer;

    decodedContent['0a2f3bb6-5190-4c02-85a9-5eecea9ed912'] = {addressHash: '0xHACKED'}

    const hackerPrivateKey = '6bd397dc89272e71165a0e7d197b280c7a88ed5b1e44e1928c25455506f1968f'
    // const publicKey = SECP256K1Client.derivePublicKey(privateKey);
    const tokenSigner = new TokenSigner("ES256K", hackerPrivateKey);
    const payload = {
        claim: decodedContent,
        issuer: { publicKey: decodedPubKey.publicKey },
        subject: { publicKey: decodedPubKey.publicKey },
    };
    const token = tokenSigner.sign(payload);
    return token;
}

describe('Security review test gaia', function(){
    beforeEach(function(){
        // @ts-ignore
        cacheStorage = new inmemStorage.InMemStorage();
        this.httpJSONRequestStub = sinon.stub(utils, 'httpJSONRequest').callsFake((args)=>{console.log("===");console.log(args);throw Error('unhandled in mocks')});
        bnsRequestFixtures.forEach(requestObj => {
            // @ts-ignore
            this.httpJSONRequestStub.withArgs(requestObj.request).returns(requestObj.response);
        });

    })
    afterEach(function(){
        this.httpJSONRequestStub.restore()
    });


    it('positive case', async function(){
        this.httpJSONRequestStub.withArgs(properResponseGaia.request).returns(properResponseGaia.response);
        const result = await getContentFromGaiaHub('ankit.zel_crux.id', "zel_" + UPLOADABLE_JSON_FILES.CRUXPAY, config.BLOCKSTACK.BNS_NODES);
        expect(result['0a2f3bb6-5190-4c02-85a9-5eecea9ed912'].addressHash).equals("DEk2DX6MbymQf3P8YsFpujCzb2pQMBH4WQ")
    });
    it('negative case - hacked encodedToken', async function(){
        const hackedGaiaResponseToken = hackAndGetToken1(properResponseGaia.response[0].token);
        this.httpJSONRequestStub.withArgs(properResponseGaia.request).returns([{
            token: hackedGaiaResponseToken,
            decodedToken: properResponseGaia.response[0].decodedToken
        }]);
        let raisedError;
        try {
            await getContentFromGaiaHub('ankit.zel_crux.id', "zel_" + UPLOADABLE_JSON_FILES.CRUXPAY, config.BLOCKSTACK.BNS_NODES);
        } catch (error) {
            raisedError = error;
        }
        expect(raisedError).is.not.undefined;
        expect(raisedError.errorCode).to.be.equal(errors.PackageErrorCode.TokenVerificationFailed);
    });
    it('negative case - hacked decodedToken', async function(){
        this.httpJSONRequestStub.withArgs(hackedDecodedTokenResponseGaia.request).returns(hackedDecodedTokenResponseGaia.response);
        const result = await getContentFromGaiaHub('ankit.zel_crux.id', "zel_" + UPLOADABLE_JSON_FILES.CRUXPAY, config.BLOCKSTACK.BNS_NODES);
        expect(result['0a2f3bb6-5190-4c02-85a9-5eecea9ed912'].addressHash).equals("DEk2DX6MbymQf3P8YsFpujCzb2pQMBH4WQ")
    });

});

describe('getContentFromGaiaHub tests', () => {
    let httpJSONRequestStub: sinon.SinonStub;
    let verifyProfileTokenStub: sinon.SinonStub;
    let publicKeyToAddressStub: sinon.SinonStub;

    beforeEach(() => {
        // @ts-ignore
        cacheStorage = new inmemStorage.InMemStorage();
        httpJSONRequestStub = sinon.stub(utils, 'httpJSONRequest').throws('unhandled in mocks')
        verifyProfileTokenStub = sinon.stub(blockstack, 'verifyProfileToken').resolves("mocked verification")
        publicKeyToAddressStub = sinon.stub(blockstack, 'publicKeyToAddress').resolves("mocked public address")

        requestFixtures.forEach(requestObj => {
            httpJSONRequestStub.withArgs(requestObj.request).returns(requestObj.response)
        })
    });

    afterEach(() => {
        httpJSONRequestStub.restore()
        verifyProfileTokenStub.restore()
        publicKeyToAddressStub.restore()
        localStorage.clear()
    });
    it('if it fails to get file content throws filename specific error', async () => {
        let request = {
            method: 'GET',
            url: 'https://gaia.cruxpay.com/1HtFkbXFWHFW5Kd4GLfiRqkffS5KLZ91eJ/client-config.json',
            json: true
        }
        httpJSONRequestStub.withArgs(request).throws("sample exception")
        
        let raisedError
        try {
            await getContentFromGaiaHub('cs1.devcoinswitch_crux.id', UPLOADABLE_JSON_FILES.CLIENT_CONFIG, config.BLOCKSTACK.BNS_NODES)
        }
        catch (error) {
            raisedError = error
        }
        expect(httpJSONRequestStub.callCount).to.be.equal(3)
        expect(raisedError).is.not.undefined
    });
    it('given token and public key, if blockstack validation fails, throws "TokenVerificationFailed"', async() => {
        let raisedError
        verifyProfileTokenStub.throws("sample exception")
        try {
            await getContentFromGaiaHub('cs1.devcoinswitch_crux.id', "devcoinswitch_" + UPLOADABLE_JSON_FILES.CRUXPAY, config.BLOCKSTACK.BNS_NODES)
        } catch (error) {
            raisedError = error
      }
        expect(httpJSONRequestStub.callCount).to.be.equal(3)
        expect(verifyProfileTokenStub.callCount).to.be.equal(1)
        expect(raisedError.errorCode).to.be.equal(errors.PackageErrorCode.TokenVerificationFailed)
    })

    it('address from gaiahub and address derived from blockstack mismatch throws "CouldNotValidateZoneFile"', async() => {
        let raisedError
        publicKeyToAddressStub.resolves("some address")
        try {
            await getContentFromGaiaHub('cs1.devcoinswitch_crux.id', "devcoinswitch_" + UPLOADABLE_JSON_FILES.CRUXPAY, config.BLOCKSTACK.BNS_NODES)
        } catch (error) {
            raisedError = error
      }
        expect(httpJSONRequestStub.callCount).to.be.equal(3)
        expect(raisedError.errorCode).to.be.equal(errors.PackageErrorCode.CouldNotValidateZoneFile)
    })
});
